import {NextApiRequest, NextApiResponse} from "next";
import QRCode from "qrcode";
import sharp from "sharp";
export default async function handler(
  req: NextApiRequest,
  res: NextApiResponse
) {
  const text = req.query.text as string || "Hello, world!";
  const qr = await QRCode.toDataURL(text);
  const svg = `
<svg width="720" height="1280" viewBox="0 0 720 1280" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="720" height="1280" fill="url(#pattern0)"/>
<image x="260" y="950" width="200" height="200" xlink:href="${qr}"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_1_5" transform="scale(0.00138889 0.00078125)"/>
</pattern>
<image id="image0_1_5" width="720" height="1280" xlink:href="data:image/jpeg;base64,"/>
</defs>
</svg>
  `;
  // make svg to jpeg, and return it
  const jpeg = await sharp(Buffer.from(svg)).jpeg().toBuffer();
  res.setHeader("Content-Type", "image/jpeg");
  res.setHeader("Cache-Control", "public, max-age=31536000, immutable");
  res.end(jpeg);
}